//import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App-header">
       <font size ="10"><p1>devjinx</p1></font>
       <font size ="5"><p2>Chareonlertkamol Thanakorns</p2></font>
       <font size="5"><p3>Student Software Develope Freelance-Dev</p3></font>
       <h1></h1>
       <a href="https://github.com/narze" class="flex mx-8 xs:mx-0 justify-center items-center gap-2 transition ease-in-out border-2 px-4 py-2 rounded border-gray-700 text-slate-400 hover:bg-gray-800 "> <svg xmlns="http://www.w3.org/2000/svg" class="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor"><path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M10 20l4-16m4 4l4 4-4 4M6 16l-4-4 4-4"></path></svg>GitHub</a>
    </div>
  );
}

export default App;
